import React from 'react'

export const Todos = (props) => {
    return (
        <div className="container">
            <h3>Todos List</h3>
            <ul>
               {props.todos.forEach(element => {
                <li>{element.No}<br/>{element.title}<br/>{element.desc}<br/><hr/></li>
            })
        }
            </ul>
        </div>
    )
}
